      SELECT DISTINCT + 79 AS col2 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) WHERE NOT NULL IS NOT NULL;
  - name: tab0
  - name: tab2

outputs:
  - name: q1826.out
    data: |
      79
